    ('2', 'ptfb-griffinot', 'https://github.com/fack2/ptfb-griffinot', 'https://ptfb-griffinot.herokuapp.com', 'Our programme is designed to teach you how to help your child to improve their fine motor skills. The programme is broken into six different sections. There are four levels that support fine motor skill development. Then, there are two additional sections designed to specifically help with pencil grasp and scissor skills.', 'https://a.top4top.io/p_1591oin821.png'),
    ('2', 'Hebron-must-see', ' https://github.com/fack2/Hebron-must-see', ' https://hebron-must-see.herokuapp.com/', 'Our website is a tourist guide for Hebron. It provides some services for Hebron new visitors. These services include showing the must-see places in hebron and their ratings. in addition to provide them with a list of most famous tourist guides for hebron tours. Moreover, the tourist can see a list of most common used words in arabic and their pronounciation to help tourists to communicate in the places they go.', 'https://d.top4top.io/p_1591wsyky1.png'),
